The Bound<'py, T> smart pointer (such as Bound<'py, PyAny>, Bound<'py, PyList>, or Bound<'py, MyClass>) can be used to call Python functions. PyO3 offers two APIs to make function calls: call - call any callable Python object. call_method - call a method on the Python object. Both of these APIs take args and kwargs arguments (for positional and keyword arguments respectively). There are variants for less complex calls: call1 and call_method1 to call only with positional args. call0 and call_method0 to call with no arguments. For convenience the Py<T> smart pointer also exposes these same six API methods, but needs a Python token as an additional first argument to prove the GIL is held. The example below calls a Python function behind a PyObject (aka Py<PyAny>) reference: use pyo3::prelude::*;
use pyo3::types::PyTuple;
use pyo3_ffi::c_str; fn main() -> PyResult<()> { let arg1 = "arg1"; let arg2 = "arg2"; let arg3 = "arg3"; Python::with_gil(|py| { let fun: Py<PyAny> = PyModule::from_code( py, c_str!("def example(*args, **kwargs): if args != (): print('called with args', args) if kwargs != {}: print('called with kwargs', kwargs) if args == () and kwargs == {}: print('called with no arguments')"), c_str!(""), c_str!(""), )? .getattr("example")? .into(); // call object without any arguments fun.call0(py)?; // pass object with Rust tuple of positional arguments let args = (arg1, arg2, arg3); fun.call1(py, args)?; // call object with Python tuple of positional arguments let args = PyTuple::new(py, &[arg1, arg2, arg3])?; fun.call1(py, args)?; Ok(()) })
}

