The IntoPyObject trait defines the to-python conversion for a Rust type. All types in PyO3 implement this trait, as does a #[pyclass] which doesn't use extends. This trait defines a single method, into_pyobject(), which returns a Result with Ok and Err types depending on the input value. For convenience, there is a companion IntoPyObjectExt trait which adds methods such as into_py_any() which converts the Ok and Err types to commonly used types (in the case of into_py_any(), Py<PyAny> and PyErr respectively). Occasionally you may choose to implement this for custom types which are mapped to Python types without having a unique python type. derive macro IntoPyObject can be implemented using our derive macro. Both structs and enums are supported. structs will turn into a PyDict using the field names as keys, tuple structs will turn convert into PyTuple with the fields in declaration order. # #![allow(dead_code)]
# use pyo3::prelude::*;
# use std::collections::HashMap;
# use std::hash::Hash; // structs convert into `PyDict` with field names as keys
#[derive(IntoPyObject)]
struct Struct { count: usize, obj: Py<PyAny>,
} // tuple structs convert into `PyTuple`
// lifetimes and generics are supported, the impl will be bounded by
// `K: IntoPyObject, V: IntoPyObject`
#[derive(IntoPyObject)]
struct Tuple<'a, K: Hash + Eq, V>(&'a str, HashMap<K, V>); For structs with a single field (newtype pattern) the #[pyo3(transparent)] option can be used to forward the implementation to the inner type. # #![allow(dead_code)]
# use pyo3::prelude::*; // newtype tuple structs are implicitly `transparent`
#[derive(IntoPyObject)]
struct TransparentTuple(PyObject); #[derive(IntoPyObject)]
#[pyo3(transparent)]
struct TransparentStruct<'py> { inner: Bound<'py, PyAny>, // `'py` lifetime will be used as the Python lifetime
} For enums each variant is converted according to the rules for structs above. # #![allow(dead_code)]
# use pyo3::prelude::*;
# use std::collections::HashMap;
# use std::hash::Hash; #[derive(IntoPyObject)]
enum Enum<'a, 'py, K: Hash + Eq, V> { // enums are supported and convert using the same TransparentTuple(PyObject), // rules on the variants as the structs above #[pyo3(transparent)] TransparentStruct { inner: Bound<'py, PyAny> }, Tuple(&'a str, HashMap<K, V>), Struct { count: usize, obj: Py<PyAny> }
} Additionally IntoPyObject can be derived for a reference to a struct or enum using the IntoPyObjectRef derive macro. All the same rules from above apply as well. #[derive(IntoPyObject)]/#[derive(IntoPyObjectRef)] Field Attributes pyo3(into_py_with = ...) apply a custom function to convert the field from Rust into Python. the argument must be the function indentifier the function signature must be fn(Cow<'_, T>, Python<'py>) -> PyResult<Bound<'py, PyAny>> where T is the Rust type of the argument. #[derive(IntoPyObject)] will invoke the function with Cow::Owned #[derive(IntoPyObjectRef)] will invoke the function with Cow::Borrowed # use pyo3::prelude::*;
# use pyo3::IntoPyObjectExt;
# use std::borrow::Cow;
#[derive(Clone)]
struct NotIntoPy(usize); #[derive(IntoPyObject, IntoPyObjectRef)]
struct MyStruct { #[pyo3(into_py_with = convert)] not_into_py: NotIntoPy,
} /// Convert `NotIntoPy` into Python
fn convert<'py>(not_into_py: Cow<'_, NotIntoPy>, py: Python<'py>) -> PyResult<Bound<'py, PyAny>> { not_into_py.0.into_bound_py_any(py)
} manual implementation If the derive macro is not suitable for your use case, IntoPyObject can be implemented manually as demonstrated below. # use pyo3::prelude::*;
# #[allow(dead_code)]
struct MyPyObjectWrapper(PyObject); impl<'py> IntoPyObject<'py> for MyPyObjectWrapper { type Target = PyAny; // the Python type type Output = Bound<'py, Self::Target>; // in most cases this will be `Bound` type Error = std::convert::Infallible; // the conversion error type, has to be convertable to `PyErr` fn into_pyobject(self, py: Python<'py>) -> Result<Self::Output, Self::Error> { Ok(self.0.into_bound(py)) }
} // equivalent to former `ToPyObject` implementations
impl<'a, 'py> IntoPyObject<'py> for &'a MyPyObjectWrapper { type Target = PyAny; type Output = Borrowed<'a, 'py, Self::Target>; // `Borrowed` can be used to optimized reference counting type Error = std::convert::Infallible; fn into_pyobject(self, py: Python<'py>) -> Result<Self::Output, Self::Error> { Ok(self.0.bind_borrowed(py)) }
} BoundObject for conversions that may be Bound or Borrowed IntoPyObject::into_py_object returns either Bound or Borrowed depending on the implementation for a concrete type. For example, the IntoPyObject implementation for u32 produces a Bound<'py, PyInt> and the bool implementation produces a Borrowed<'py, 'py, PyBool>: use pyo3::prelude::*;
use pyo3::IntoPyObject;
use pyo3::types::{PyBool, PyInt}; let ints: Vec<u32> = vec![1, 2, 3, 4];
let bools = vec![true, false, false, true]; Python::with_gil(|py| { let ints_as_pyint: Vec<Bound<'_, PyInt>> = ints .iter() .map(|x| Ok(x.into_pyobject(py)?)) .collect::<PyResult<_>>() .unwrap(); let bools_as_pybool: Vec<Borrowed<'_, '_, PyBool>> = bools .iter() .map(|x| Ok(x.into_pyobject(py)?)) .collect::<PyResult<_>>() .unwrap();
}); In this example if we wanted to combine ints_as_pyints and bools_as_pybool into a single Vec<Py<PyAny>> to return from the with_gil closure, we would have to manually convert the concrete types for the smart pointers and the python types. Instead, we can write a function that generically converts vectors of either integers or bools into a vector of Py<PyAny> using the BoundObject trait: # use pyo3::prelude::*;
# use pyo3::BoundObject;
# use pyo3::IntoPyObject; # let bools = vec![true, false, false, true];
# let ints = vec![1, 2, 3, 4]; fn convert_to_vec_of_pyobj<'py, T>(py: Python<'py>, the_vec: Vec<T>) -> PyResult<Vec<Py<PyAny>>>
where T: IntoPyObject<'py> + Copy
{ the_vec.iter() .map(|x| { Ok( // Note: the below is equivalent to `x.into_py_any()` // from the `IntoPyObjectExt` trait x.into_pyobject(py) .map_err(Into::into)? .into_any() .unbind() ) }) .collect()
} let vec_of_pyobjs: Vec<Py<PyAny>> = Python::with_gil(|py| { let mut bools_as_pyany = convert_to_vec_of_pyobj(py, bools).unwrap(); let mut ints_as_pyany = convert_to_vec_of_pyobj(py, ints).unwrap(); let mut result: Vec<Py<PyAny>> = vec![]; result.append(&mut bools_as_pyany); result.append(&mut ints_as_pyany); result
}); In the example above we used BoundObject::into_any and BoundObject::unbind to manipulate the python types and smart pointers into the result type we wanted to produce from the function.

