There is currently no simple way to release the GIL when awaiting a future, but solutions are currently in development . Here is the advised workaround for now: use std::{ future::Future, pin::{Pin, pin}, task::{Context, Poll},
};
use pyo3::prelude::*; struct AllowThreads<F>(F); impl<F> Future for AllowThreads<F>
where F: Future + Unpin + Send, F::Output: Send,
{ type Output = F::Output; fn poll(mut self: Pin<&mut Self>, cx: &mut Context<'_>) -> Poll<Self::Output> { let waker = cx.waker(); Python::with_gil(|gil| { gil.allow_threads(|| pin!(&mut self.0).poll(&mut Context::from_waker(waker))) }) }
