Data attached to pyclass instances is protected from concurrent access by a RefCell-like pattern of runtime borrow checking. Like a RefCell, PyO3 will raise exceptions (or in some cases panic) to enforce exclusive access for mutable borrows. It was always possible to generate panics like this in PyO3 in code that releases the GIL with Python::allow_threads or calling a python method accepting &self from a &mut self (see the docs on interior mutability ,) but now in free-threaded Python there are more opportunities to trigger these panics from Python because there is no GIL to lock concurrent access to mutably borrowed data from Python. The most straightforward way to trigger this problem is to use the Python threading module to simultaneously call a rust function that mutably borrows a pyclass in multiple threads. For example, consider the following implementation: # use pyo3::prelude::*;
# fn main() {
#[pyclass]
#[derive(Default)]
struct ThreadIter { count: usize,
} #[pymethods]
impl ThreadIter { #[new] pub fn new() -> Self { Default::default() } fn __next__(&mut self, py: Python<'_>) -> usize { self.count += 1; self.count }
}
# } And then if we do something like this in Python: import concurrent.futures
from my_module import ThreadIter i = ThreadIter() def increment(): next(i) with concurrent.futures.ThreadPoolExecutor(max_workers=16) as tpe: futures = [tpe.submit(increment) for _ in range(100)] [f.result() for f in futures] We will see an exception: Traceback (most recent call last) File "example.py", line 5, in <module> next(i)
RuntimeError: Already borrowed We plan to allow user-selectable semantics for mutable pyclass definitions in PyO3 0.24, allowing some form of opt-in locking to emulate the GIL if that is needed. For now you should explicitly add locking, possibly using conditional compilation or using the critical section API, to avoid creating deadlocks with the GIL.

