# #[cfg(not(Py_GIL_DISABLED))] {
# use pyo3::prelude::*;
use pyo3::sync::GILProtected;
use pyo3::types::{PyDict, PyNone};
use std::cell::RefCell; static OBJECTS: GILProtected<RefCell<Vec<Py<PyDict>>>> = GILProtected::new(RefCell::new(Vec::new())); Python::with_gil(|py| { // stand-in for something that executes arbitrary Python code let d = PyDict::new(py); d.set_item(PyNone::get(py), PyNone::get(py)).unwrap(); OBJECTS.get(py).borrow_mut().push(d.unbind());
});
# }} After: # use pyo3::prelude::*;
# fn main() {
use pyo3::types::{PyDict, PyNone};
use std::sync::Mutex; static OBJECTS: Mutex<Vec<Py<PyDict>>> = Mutex::new(Vec::new()); Python::with_gil(|py| { // stand-in for something that executes arbitrary Python code let d = PyDict::new(py); d.set_item(PyNone::get(py), PyNone::get(py)).unwrap(); // as with any `Mutex` usage, lock the mutex for as little time as possible // in this case, we do it just while pushing into the `Vec` OBJECTS.lock().unwrap().push(d.unbind());
});
# } If you are executing arbitrary Python code while holding the lock, then you should import the MutexExt trait and use the lock_py_attached method instead of lock. This ensures that global synchronization events started by the Python runtime can proceed, avoiding possible deadlocks with the interpreter.

