The similarly-named pyo3-python-tracing-subscriber implements a shim in Rust that forwards tracing data to a Layer implementation defined in and passed in from Python. There are many ways an extension module could integrate pyo3-python-tracing-subscriber but a simple one may look something like this: #[tracing::instrument]
#[pyfunction]
fn fibonacci(index: usize, use_memoized: bool) -> PyResult<usize> { // ...
} #[pyfunction]
pub fn initialize_tracing(py_impl: Bound<'_, PyAny>) { tracing_subscriber::registry() .with(pyo3_python_tracing_subscriber::PythonCallbackLayerBridge::new(py_impl)) .init();
} The extension module must provide some way for Python to pass in one or more Python objects that implement the Layer interface . Then it should construct pyo3_python_tracing_subscriber::PythonCallbackLayerBridge instances with each of those Python objects and initialize tracing_subscriber as shown above. The Python objects implement a modified version of the Layer interface: on_new_span() may return some state that will stored inside the Rust span other callbacks will be given that state as an additional positional argument A dummy Layer implementation may look like this: import rust_extension class MyPythonLayer: def __init__(self): pass # `on_new_span` can return some state def on_new_span(self, span_attrs: str, span_id: str) -> int: print(f"[on_new_span]: {span_attrs} | {span_id}") return random.randint(1, 1000) # The state from `on_new_span` is passed back into other trait methods def on_event(self, event: str, state: int): print(f"[on_event]: {event} | {state}") def on_close(self, span_id: str, state: int): print(f"[on_close]: {span_id} | {state}") def on_record(self, span_id: str, values: str, state: int): print(f"[on_record]: {span_id} | {values} | {state}") def main(): rust_extension.initialize_tracing(MyPythonLayer()) print("10th fibonacci number: ", rust_extension.fibonacci(10, True)) pyo3-python-tracing-subscriber has working examples showing both the Rust side and the Python side of an integration.

