Click to expand PyO3 0.23 introduces a new IntoPyObject trait to convert Rust types into Python objects which replaces both IntoPy and ToPyObject. Notable features of this new trait include: conversions can now return an error it is designed to work efficiently for both T owned types and &T references compared to IntoPy<T> the generic T moved into an associated type, so there is now only one way to convert a given type the output type is stronger typed and may return any Python type instead of just PyAny byte collections are specialized to convert into PyBytes now, see below () (unit) is now only specialized in return position of #[pyfunction] and #[pymethods] to return None, in normal usage it converts into an empty PyTuple All PyO3 provided types as well as #[pyclass]es already implement IntoPyObject. Other types will need to adapt an implementation of IntoPyObject to stay compatible with the Python APIs. In many cases the new #[derive(IntoPyObject)] macro can be used instead of manual implementations . Since IntoPyObject::into_pyobject may return either a Bound or Borrowed, you may find the BoundObject trait to be useful to write code that generically handles either type of smart pointer. Together with the introduction of IntoPyObject the old conversion traits ToPyObject and IntoPy are deprecated and will be removed in a future PyO3 version. IntoPyObject and IntoPyObjectRef derive macros To implement the new trait you may use the new IntoPyObject and IntoPyObjectRef derive macros as below. # use pyo3::prelude::*;
#[derive(IntoPyObject, IntoPyObjectRef)]
struct Struct { count: usize, obj: Py<PyAny>,
} The IntoPyObjectRef derive macro derives implementations for references (e.g. for &Struct in the example above), which is a replacement for the ToPyObject trait. IntoPyObject manual implementation Before: # use pyo3::prelude::*;
# #[allow(dead_code)]
struct MyPyObjectWrapper(PyObject); impl IntoPy<PyObject> for MyPyObjectWrapper { fn into_py(self, py: Python<'_>) -> PyObject { self.0 }
} impl ToPyObject for MyPyObjectWrapper { fn to_object(&self, py: Python<'_>) -> PyObject { self.0.clone_ref(py) }
} After: # use pyo3::prelude::*;
# #[allow(dead_code)]
# struct MyPyObjectWrapper(PyObject); impl<'py> IntoPyObject<'py> for MyPyObjectWrapper { type Target = PyAny; // the Python type type Output = Bound<'py, Self::Target>; // in most cases this will be `Bound` type Error = std::convert::Infallible; fn into_pyobject(self, py: Python<'py>) -> Result<Self::Output, Self::Error> { Ok(self.0.into_bound(py)) }
} // `ToPyObject` implementations should be converted to implementations on reference types
impl<'a, 'py> IntoPyObject<'py> for &'a MyPyObjectWrapper { type Target = PyAny; type Output = Borrowed<'a, 'py, Self::Target>; // `Borrowed` can be used to optimized reference counting type Error = std::convert::Infallible; fn into_pyobject(self, py: Python<'py>) -> Result<Self::Output, Self::Error> { Ok(self.0.bind_borrowed(py)) }
}

