Click to expand PyO3 0.23 completes the removal of the "GIL Refs" API in favour of the new "Bound" API introduced in PyO3 0.21. With the removal of the old API, many "Bound" API functions which had been introduced with _bound suffixes no longer need the suffixes as these names have been freed up. For example, PyTuple::new_bound is now just PyTuple::new (the existing name remains but is deprecated). Before: # #![allow(deprecated)]
# use pyo3::prelude::*;
# use pyo3::types::PyTuple;
# fn main() {
# Python::with_gil(|py| {
// For example, for PyTuple. Many such APIs have been changed.
let tup = PyTuple::new_bound(py, [1, 2, 3]);
# })
# } After: # use pyo3::prelude::*;
# use pyo3::types::PyTuple;
# fn main() {
# Python::with_gil(|py| {
// For example, for PyTuple. Many such APIs have been changed.
let tup = PyTuple::new(py, [1, 2, 3]);
# })
# } IntoPyDict trait adjusted for removal of gil-refs As part of this API simplification, the IntoPyDict trait has had a small breaking change: IntoPyDict::into_py_dict_bound method has been renamed to IntoPyDict::into_py_dict. It is also now fallible as part of the IntoPyObject trait addition. If you implemented IntoPyDict for your type, you should implement into_py_dict instead of into_py_dict_bound. The old name is still available for calling but deprecated. Before: # use pyo3::prelude::*;
# use pyo3::types::{PyDict, IntoPyDict};
# use std::collections::HashMap; struct MyMap<K, V>(HashMap<K, V>); impl<K, V> IntoPyDict for MyMap<K, V>
where K: ToPyObject, V: ToPyObject,
{ fn into_py_dict_bound(self, py: Python<'_>) -> Bound<'_, PyDict> { let dict = PyDict::new_bound(py); for (key, value) in self.0 { dict.set_item(key, value) .expect("Failed to set_item on dict"); } dict }
} After: # use pyo3::prelude::*;
# use pyo3::types::{PyDict, IntoPyDict};
# use std::collections::HashMap; # #[allow(dead_code)]
struct MyMap<K, V>(HashMap<K, V>); impl<'py, K, V> IntoPyDict<'py> for MyMap<K, V>
where K: IntoPyObject<'py>, V: IntoPyObject<'py>,
{ fn into_py_dict(self, py: Python<'py>) -> PyResult<Bound<'py, PyDict>> { let dict = PyDict::new(py); for (key, value) in self.0 { dict.set_item(key, value)?; } Ok(dict) }
}

