Let's work with the following basic example of an implementation of a optimization solver operating on a given model. Let's say we have a function solve that operates on a model and mutates its state. The argument of the function can be any model that implements the Model trait : # #![allow(dead_code)]
pub trait Model { fn set_variables(&mut self, inputs: &Vec<f64>); fn compute(&mut self); fn get_results(&self) -> Vec<f64>;
} pub fn solve<T: Model>(model: &mut T) { println!("Magic solver that mutates the model into a resolved state");
} Let's assume we have the following constraints: We cannot change that code as it runs on many Rust models. We also have many Python models that cannot be solved as this solver is not available in that language. Rewriting it in Python would be cumbersome and error-prone, as everything is already available in Rust. How could we expose this solver to Python thanks to PyO3 ?

