use pyo3::prelude::*;
use pyo3::types::PyList; pub trait Model { fn set_variables(&mut self, var: &Vec<f64>); fn get_results(&self) -> Vec<f64>; fn compute(&mut self);
} pub fn solve<T: Model>(model: &mut T) { println!("Magic solver that mutates the model into a resolved state");
} #[pyfunction]
#[pyo3(name = "solve")]
pub fn solve_wrapper(model: &mut UserModel) { solve(model);
} #[pyclass]
pub struct UserModel { model: Py<PyAny>,
} #[pymodule]
fn trait_exposure(m: &Bound<'_, PyModule>) -> PyResult<()> { m.add_class::<UserModel>()?; m.add_function(wrap_pyfunction!(solve_wrapper, m)?)?; Ok(())
