To integrate Rust types with Python, PyO3 needs to place some restrictions on the types which can be annotated with #[pyclass]. In particular, they must have no lifetime parameters, no generic parameters, and must be thread-safe. The reason for each of these is explained below. No lifetime parameters Rust lifetimes are used by the Rust compiler to reason about a program's memory safety. They are a compile-time only concept; there is no way to access Rust lifetimes at runtime from a dynamic language like Python. As soon as Rust data is exposed to Python, there is no guarantee that the Rust compiler can make on how long the data will live. Python is a reference-counted language and those references can be held for an arbitrarily long time which is untraceable by the Rust compiler. The only possible way to express this correctly is to require that any #[pyclass] does not borrow data for any lifetime shorter than the 'static lifetime, i.e. the #[pyclass] cannot have any lifetime parameters. When you need to share ownership of data between Python and Rust, instead of using borrowed references with lifetimes consider using reference-counted smart pointers such as Arc or Py . No generic parameters A Rust struct Foo<T> with a generic parameter T generates new compiled implementations each time it is used with a different concrete type for T. These new implementations are generated by the compiler at each usage site. This is incompatible with wrapping Foo in Python, where there needs to be a single compiled implementation of Foo which is integrated with the Python interpreter. Currently, the best alternative is to write a macro which expands to a new #[pyclass] for each instantiation you want: # #![allow(dead_code)]
use pyo3::prelude::*; struct GenericClass<T> { data: T,
} macro_rules! create_interface { ($name: ident, $type: ident) => { #[pyclass] pub struct $name { inner: GenericClass<$type>, } #[pymethods] impl $name { #[new] pub fn new(data: $type) -> Self { Self { inner: GenericClass { data: data }, } } } };
} create_interface!(IntClass, i64);
create_interface!(FloatClass, String); Must be thread-safe Python objects are freely shared between threads by the Python interpreter. This means that: Python objects may be created and destroyed by different Python threads; therefore #[pyclass] objects must be Send. Python objects may be accessed by multiple Python threads simultaneously; therefore #[pyclass] objects must be Sync. For now, don't worry about these requirements; simple classes will already be thread-safe. There is a detailed discussion on thread-safety later in the guide.

