It is often useful to turn a #[pyclass] type T into a Python object and access it from Rust code. The [Py<T>] and [Bound<'py, T>] smart pointers are the ways to represent a Python object in PyO3's API. More detail can be found about them in the Python objects section of the guide. Most Python objects do not offer exclusive (&mut) access (see the section on Python's memory model ). However, Rust structs wrapped as Python objects (called pyclass types) often do need &mut access. Due to the GIL, PyO3 can guarantee exclusive access to them. The Rust borrow checker cannot reason about &mut references once an object's ownership has been passed to the Python interpreter. This means that borrow checking is done at runtime using with a scheme very similar to std::cell::RefCell<T>. This is known as interior mutability . Users who are familiar with RefCell<T> can use Py<T> and Bound<'py, T> just like RefCell<T>. For users who are not very familiar with RefCell<T>, here is a reminder of Rust's rules of borrowing: At any given time, you can have either (but not both of) one mutable reference or any number of immutable references. References can never outlast the data they refer to. Py<T> and Bound<'py, T>, like RefCell<T>, ensure these borrowing rules by tracking references at runtime. # use pyo3::prelude::*;
#[pyclass]
struct MyClass { #[pyo3(get)] num: i32,
}
Python::with_gil(|py| { let obj = Bound::new(py, MyClass { num: 3 }).unwrap(); { let obj_ref = obj.borrow(); // Get PyRef assert_eq!(obj_ref.num, 3); // You cannot get PyRefMut unless all PyRefs are dropped assert!(obj.try_borrow_mut().is_err()); } { let mut obj_mut = obj.borrow_mut(); // Get PyRefMut obj_mut.num = 5; // You cannot get any other refs until the PyRefMut is dropped assert!(obj.try_borrow().is_err()); assert!(obj.try_borrow_mut().is_err()); } // You can convert `Bound` to a Python object pyo3::py_run!(py, obj, "assert obj.num == 5");
}); A Bound<'py, T> is restricted to the GIL lifetime 'py. To make the object longer lived (for example, to store it in a struct on the Rust side), use Py<T>. Py<T> needs a Python<'_> token to allow access: # use pyo3::prelude::*;
#[pyclass]
struct MyClass { num: i32,
} fn return_myclass() -> Py<MyClass> { Python::with_gil(|py| Py::new(py, MyClass { num: 1 }).unwrap())
} let obj = return_myclass(); Python::with_gil(move |py| { let bound = obj.bind(py); // Py<MyClass>::bind returns &Bound<'py, MyClass> let obj_ref = bound.borrow(); // Get PyRef<T> assert_eq!(obj_ref.num, 1);
});

