} let py_counter: Py<FrozenCounter> = Python::with_gil(|py| { let counter = FrozenCounter { value: AtomicUsize::new(0), }; Py::new(py, counter).unwrap()
}); py_counter.get().value.fetch_add(1, Ordering::Relaxed); Python::with_gil(move |_py| drop(py_counter)); Frozen classes are likely to become the default thereby guiding the PyO3 ecosystem towards a more deliberate application of interior mutability. Eventually, this should enable further optimizations of PyO3's internals and avoid downstream code paying the cost of interior mutability when it is not actually required.

