The magic methods in this section can be used to implement Python container types. They are two main categories of container in Python: "mappings" such as dict, with arbitrary keys, and "sequences" such as list and tuple, with integer keys. The Python C-API which PyO3 is built upon has separate "slots" for sequences and mappings. When writing a class in pure Python, there is no such distinction in the implementation - a __getitem__ implementation will fill the slots for both the mapping and sequence forms, for example. By default PyO3 reproduces the Python behaviour of filling both mapping and sequence slots. This makes sense for the "simple" case which matches Python, and also for sequences, where the mapping slot is used anyway to implement slice indexing. Mapping types usually will not want the sequence slots filled. Having them filled will lead to outcomes which may be unwanted, such as: The mapping type will successfully cast to PySequence . This may lead to consumers of the type handling it incorrectly. Python provides a default implementation of __iter__ for sequences, which calls __getitem__ with consecutive positive integers starting from 0 until an IndexError is returned. Unless the mapping only contains consecutive positive integer keys, this __iter__ implementation will likely not be the intended behavior. Use the #[pyclass(mapping)] annotation to instruct PyO3 to only fill the mapping slots, leaving the sequence ones empty. This will apply to __getitem__, __setitem__, and __delitem__. Use the #[pyclass(sequence)] annotation to instruct PyO3 to fill the sq_length slot instead of the mp_length slot for __len__. This will help libraries such as numpy recognise the class as a sequence, however will also cause CPython to automatically add the sequence length to any negative indices before passing them to __getitem__. (__getitem__, __setitem__ and __delitem__ mapping slots are still used for sequences, for slice operations.) __len__(<self>) -> usize Implements the built-in function len(). __contains__(<self>, object) -> bool Implements membership test operators. Should return true if item is in self, false otherwise. For objects that don’t define __contains__(), the membership test simply traverses the sequence until it finds a match. Disabling Python's default contains By default, all #[pyclass] types with an __iter__ method support a default implementation of the in operator. Types which do not want this can override this by setting __contains__ to None. This is the same mechanism as for a pure-Python class. This is done like so: # use pyo3::prelude::*;
#
#[pyclass]
struct NoContains {} #[pymethods]
impl NoContains { #[classattr] const __contains__: Option<PyObject> = None;
} __getitem__(<self>, object) -> object Implements retrieval of the self[a] element. Note: Negative integer indexes are not handled specially by PyO3. However, for classes with #[pyclass(sequence)], when a negative index is accessed via PySequence::get_item, the underlying C API already adjusts the index to be positive. __setitem__(<self>, object, object) -> () Implements assignment to the self[a] element. Should only be implemented if elements can be replaced. Same behavior regarding negative indices as for __getitem__. __delitem__(<self>, object) -> () Implements deletion of the self[a] element. Should only be implemented if elements can be deleted. Same behavior regarding negative indices as for __getitem__. fn __concat__(&self, other: impl FromPyObject) -> PyResult<impl ToPyObject> Concatenates two sequences. Used by the + operator, after trying the numeric addition via the __add__ and __radd__ methods. fn __repeat__(&self, count: isize) -> PyResult<impl ToPyObject> Repeats the sequence count times. Used by the * operator, after trying the numeric multiplication via the __mul__ and __rmul__ methods. fn __inplace_concat__(&self, other: impl FromPyObject) -> PyResult<impl ToPyObject> Concatenates two sequences. Used by the += operator, after trying the numeric addition via the __iadd__ method. fn __inplace_repeat__(&self, count: isize) -> PyResult<impl ToPyObject> Concatenates two sequences. Used by the *= operator, after trying the numeric multiplication via the __imul__ method.

