The general challenge with thread-safety is to make sure that two threads cannot produce a data race, i.e. unsynchronized writes to the same data at the same time. A data race produces an unpredictable result and is forbidden by Rust. By default, #[pyclass] employs an "interior mutability" pattern to allow for either multiple &T references or a single exclusive &mut T reference to access the data. This allows for simple #[pyclass] types to be thread-safe automatically, at the cost of runtime checking for concurrent access. Errors will be raised if the usage overlaps. For example, the below simple class is thread-safe: # use pyo3::prelude::*; #[pyclass]
struct MyClass { x: i32, y: i32,
} #[pymethods]
impl MyClass { fn get_x(&self) -> i32 { self.x } fn set_y(&mut self, value: i32) { self.y = value; }
} In the above example, if calls to get_x and set_y overlap (from two different threads) then at least one of those threads will experience a runtime error indicating that the data was "already borrowed". To avoid these errors, you can take control of the interior mutability yourself in one of the following ways.

