To remove the possibility of having overlapping &self and &mut self references produce runtime errors, consider using #[pyclass(frozen)] and use atomic data structures to control modifications directly. For example, a thread-safe version of the above MyClass using atomic integers would be as follows: # use pyo3::prelude::*;
use std::sync::atomic::{AtomicI32, Ordering}; #[pyclass(frozen)]
struct MyClass { x: AtomicI32, y: AtomicI32,
} #[pymethods]
impl MyClass { fn get_x(&self) -> i32 { self.x.load(Ordering::Relaxed) } fn set_y(&self, value: i32) { self.y.store(value, Ordering::Relaxed) }
}

