An alternative to atomic data structures is to use locks to make threads wait for access to shared data. For example, a thread-safe version of the above MyClass using locks would be as follows: # use pyo3::prelude::*;
use std::sync::Mutex; struct MyClassInner { x: i32, y: i32,
} #[pyclass(frozen)]
struct MyClass { inner: Mutex<MyClassInner>
} #[pymethods]
impl MyClass { fn get_x(&self) -> i32 { self.inner.lock().expect("lock not poisoned").x } fn set_y(&self, value: i32) { self.inner.lock().expect("lock not poisoned").y = value; }
} If you need to lock around state stored in the Python interpreter or otherwise call into the Python C API while a lock is held, you might find the MutexExt trait useful. It provides a lock_py_attached method for std::sync::Mutex that avoids deadlocks with the GIL or other global synchronization events in the interpreter.
